import React from 'react';
import Footer from '../../components/Footer';
import Header from '../../components/Header';
import '../../assets/style/global.css';
import './style.css';

function Vagas() {

    return (
        <div>
            <Header/>
            <div className="vagas">
                <h1>Encontre sua vaga!</h1>

            </div>
            <Footer/>
        </div>
    )
}

export default Vagas;
